import React from 'react';
import './about.css';
function About() {
  return (
    <div id="text">
      <h1>Sobre Nós</h1>
      <hr></hr>
      <p>Bem-vindo à página sobre nós da Belive Arquitetura!</p>
      <section>
        <p>Há 30 anos, começamos uma jornada apaixonante pelo mundo da Arquitetura e Urbanismo. Desde o início, nosso propósito sempre foi claro: transformar sonhos em realidade, um projeto de cada vez.<br></br>

        Com uma rica experiência acumulada ao longo das décadas, nossa equipe se dedicou ao desenvolvimento de projetos inovadores e ao gerenciamento de obras com precisão e excelência. Cada lar que ajudamos a construir é mais do que apenas um projeto; é um reflexo dos desejos e necessidades de quem nele viverá.<br></br>

        Na nossa empresa, acreditamos que cada espaço tem um potencial único, e estamos aqui para revelar o melhor dele. Seja você um cliente em busca de uma nova casa ou alguém precisando de uma renovação, estamos prontos para transformar suas ideias em realidade.</p>
      </section>
    </div>
  );
}

export default About;
